import TypewriterComponent from "typewriter-effect";

new Typewriter('#typewriter', {
  strings: ['Hello', 'World'],
  autoStart: true,
});


function typingAnimation(){
    return 
    <Typewriter
      options={{
        strings: ['Hello', 'World'],
        autoStart: true,
        loop: true,
      }}
    />;
}

export default typingAnimation;
